import Texto from "../Texto";

const Container = styled.div`

    display: flex; 
    align-itens: center; 

`;

const Image = styled.img`

    width: 50%;

`;

function Introducao(){
    return(
        <Container>
            <Image src="/src/images/fundo_place_holder.jpg" alt="Description"/>
            <Text></Text>
        </Container>
    )
}

export default Introducao
